import PropTypes from 'prop-types'

const Link = ({ children, onClick }) => (
  <a href="#" onClick={(e) => {
    e.preventDefault
  }}>{children}</a>
)

Link.propTypes = {
  children: PropTypes.node.isRequired
}

export default Link
